react组件的生命周期可以分为三个阶段： 1. 挂载阶段： 组件被创建并插入到DOM中，此时组件的状态是未知的，组件的属性和状态都可以被设置。 2. 更新阶段： 组件的状态发生变化，组件需要重新渲染，此时组件的属性和状态都可以被更新。 3. 卸载阶段： 组件从DOM中移除，此时组件的状态也会被销毁。 rect-lifecycle constructor(props) 挂载时独有的初始化方法，在这个方法中，可以对组件的状态进行初始化。 render() 一个很重要的生命周期，它返回一个React元素，描述了组件在屏幕上应该呈现的内容。 传入props,setState(),forceUpdate()等方法可以触发更新。 shouldComponentUpdate() 一个函数，在组件接收到新的props或state时，会调用这个函数，用来判断是否需要更新组件。通常在render之前 React update DOM and refs 当组件的状态发生变化时，会调用render方法重新渲染组件，然后React更新DOM并更新组件的refs。 example import './App.css';
